              type="text"
              name="nome"
              placeholder="nome"
              value={ nome }
              onChange={ ({ }) }
            />
            <input
              type="text"
              name="especies"
              placeholder="especie"
              value={ nome }
              onChange={ ({ }) }
            />
            <input
              type="text"
              name="genero"
              placeholder="genero"
              value={ nome }
              onChange={ ({ }) }
            />
            <input
              type="text"
              name="status"
              // placeholder="status" vivo ou morto
              value={ status }
              onChange={ ({ }) }
            />
            <input
              type="text"
              name="quantidade"
              placeholder="quantidade"
              value={ quantidade }
              onChange={ ({ }) }
            />
          </label>
        </form>
      </header>
    </div>
  );
}

export default Table;
